import React,{Component} from 'react';

import { BrowserRouter as Route} from 'react-router-dom';

import LayoutWithRoute from './components/Layout/index';

class App extends Component {
        render() {
                return (
                  <div>
                        <Route
                                render={(routeProps) => (
                                        <LayoutWithRoute>
                                                <Component {...routeProps} />
                                        </LayoutWithRoute>
                                )}
                        />
                  </div>
                );
              }
}

export default App;
